import { BrowserRouter, Route} from "react-router-dom"
import {Switch} from "react-router"
import Home from "./core/Home"

const Routes = () => {
    return(
        <BrowserRouter>
            <Switch>
                <Route path="/" exact component={Home} />
            </Switch>
        </BrowserRouter>
    )
}

export default Routes;
